import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button className="nav-button">Home</button>
        <button className="nav-button">Products</button>
        <button className="nav-button">Pricing</button>
      </header>
    </div>
  );
}

export default App;
